const BoletimTwo = () => {
    return (
        <div>
            <Navbar style={{ background: "linear-gradient(to right, #0d47a1, #4a148c, #8e24aa, #b71c1c, #e53935, #ec407a)" }}>
                <div>
                    <h5 className="text-light">O governo acredita em vocÃª estudante!</h5>
                </div>
            </Navbar>
            <row>
                <Image src="http://www.agerba.ba.gov.br/sites/default/files/styles/crop_banner_full/public/banners/2020-03/Full%20Banner%20-%20Carteira%20de%20Estudante%20Ferry%20Boat%20e%20Lancha_v2.png?itok=E1OiGjMj" width="100%" fluid />
            </row>
        </div>
    );
}
export default BoletimTwo;
